item.js:
/* mixpanel */
mixpanel.track("Page View", {"page": "Welcome" }, function() { console.log('track call succeeded') });

{{ user:logged_in }}
mixpanel.identify("{{ user:id }}");
mixpanel.people.set({
  "$email": "{{ user:email }}",    // only special properties need the $
  "$created": "{{ user:created_on }}",
  "$last_login": new Date(),         // properties can be dates...
});
mixpanel.name_tag('{{ user:email }}');
{{ /user:logged_in }}

